import React from "react";
import { Card } from "react-bootstrap";

const SkillsPersonales = (props) => (
  <div className="d-flex justify-content-center items-center ">
    <Card style={{ width: "7rem", margin: "10px" }}>
      <Card.Img variant="top" src={props.imagenUrl} style={{ width: "4rem", }}/>
      <Card.Title className="m-3 d-flex justify-content-center items-center h6 small">
        {props.titulo}
      </Card.Title>
    </Card>
  </div>
);

export default SkillsPersonales;
